import React, { Component } from "react";
import './navBar.css'
export default function TableContact({ list }) {
    const { contact, getPerson } = this.props;
  return (
    <table className="tableTickets">
      <thead>
        <tr>         
          <th className="titleTableTicket" colSpan="3"> Ticket tasks to do</th>
        </tr>
        <tr className="ticketTable">
          <td>ID</td>
          <td>Title (tickets)</td>
          <td>Description</td>
        </tr>
      </thead>
      <tbody className="Tickets">
        {list.map(contact =>            
            <tr >              
              <td> {contact.fullName}</td>
              <td> {contact.email}</td>
              <td> {contact.mobile}</td>
            </tr>
        )}
      </tbody>
    </table>
  );
}
